import { Box, Typography } from '@material-ui/core';
import * as React from 'react';

interface Props {
  text: string
}

export const ByoaSDK = ({ text }: Props) => {
  return (
    <Box>
      <Typography variant='h1'>Comp: {text}</Typography>
    </Box>
  )
}
